import {useState} from 'react'
import CarData from '../data/CarData'

function CarList() {
    let [cardata, setcardata] =useState(CarData)
    return(
        <div className="row">
        {
            cardata.map((a,i)=>{
            return <Card shoes={cardata[i]} i={i} key={a.id}/>
            })
        } 
    </div>

    )

}


function Card(props) {
    return(
        <div>
        <h4>{props.cardata[0].number}</h4>
        <p>{props.cardata[0].type}</p>
        <p>{props.cardata[0].location}</p>
        </div>
    )

}

export default CarList
